(3, 20, 'Feirão Show Car com o apoio do Bradesco!', 'O Feirão Show Car, em parceria com o Bradesco, traz até você a melhor seleção de veículos, com as melhores condições do mercado. São diversos modelos revisados, de procedência garantida, com taxas especiais de financiamento e toda a segurança que você merece.\r\n\r\nCom o apoio do Bradesco, além de encontrar o carro ideal, você conta com:', '2023-08-19 00:38:24', '2025-06-13 19:41:22');
