INSERT INTO `faqs` (`id`, `language_id`, `question`, `answer`, `serial_number`, `created_at`, `updated_at`) VALUES
(16, 20, 'Como posso anunciar meu carro no seu site?', 'Para anunciar seu carro, basta criar uma conta em nosso site, fornecer informações precisas sobre o veículo, enviar fotos de alta qualidade e definir um preço apropriado.', 1, '2023-08-19 02:29:36', '2025-06-11 02:36:22'),
(17, 20, 'Posso anunciar vários carros em uma conta?', 'Sim, você pode anunciar vários carros usando uma única conta. Basta seguir o mesmo processo de anúncio para cada veículo.', 2, '2023-08-19 02:29:51', '2025-06-11 02:36:09'),
(18, 20, 'Existe alguma taxa para anunciar meu carro na sua plataforma?', 'Oferecemos opções de anúncios gratuitas e premium. Os anúncios básicos são gratuitos, enquanto as opções premium podem incluir visibilidade aprimorada e recursos adicionais mediante o pagamento de uma taxa.', 3, '2023-08-19 02:30:06', '2025-06-11 02:35:56'),
(19, 20, 'Que tipo de informação devo incluir no meu anúncio de carro?', 'É importante fornecer informações detalhadas, como marca, modelo, ano, quilometragem, estado de conservação, características e histórico de acidentes ou reparos. Quanto mais detalhes você fornecer, maiores serão suas chances de atrair potenciais compradores.', 4, '2023-08-19 02:30:22', '2025-06-11 02:35:42'),
(20, 20, 'Por quanto tempo meu anúncio de carro ficará ativo?', 'A duração do anúncio do seu carro depende do tipo de anúncio escolhido. Anúncios gratuitos geralmente têm uma duração padrão, enquanto anúncios premium podem ter períodos de visibilidade mais longos.', 5, '2023-08-19 02:30:37', '2025-06-11 02:35:28'),
(21, 20, 'Posso editar meu anúncio depois que ele estiver no ar?', 'Sim, você pode editar seu anúncio a qualquer momento. Entre na sua conta, acesse seu anúncio e faça as alterações necessárias nos detalhes, preço ou imagens.', 6, '2023-08-19 02:30:55', '2025-06-11 02:35:15'),
(22, 20, 'Como posso me comunicar com potenciais compradores?', 'Compradores interessados ​​podem entrar em contato com você por meio das informações de contato fornecidas no seu anúncio. Recomendamos o uso do nosso sistema de mensagens seguro para manter a privacidade e a segurança durante as negociações.', 7, '2023-08-19 02:31:11', '2025-06-11 02:35:02'),
(23, 20, 'O que acontece se meu carro for vendido por outra plataforma?', 'Se o seu carro for vendido por outra plataforma, é importante remover ou marcar imediatamente o seu anúncio como vendido em nosso site para evitar qualquer confusão para potenciais compradores.', 8, '2023-08-19 02:31:29', '2025-06-11 02:34:45'),
(24, 20, 'Há alguma dica para tirar fotos atraentes de carros?', 'Com certeza! Fotos nítidas e bem iluminadas, tiradas de vários ângulos, podem valorizar significativamente o seu anúncio. Inclua fotos do interior, exterior, motor e quaisquer características especiais.', 9, '2023-08-19 02:31:45', '2025-06-11 02:34:27'),
(25, 20, 'Quais medidas de segurança estão em vigor para evitar fraudes?', 'Levamos a prevenção de fraudes a sério. Utilizamos diversas medidas de segurança e recomendamos negociar localmente, verificar as informações do comprador e ter cuidado com solicitações de pagamento incomuns.', 10, '2023-08-19 02:32:01', '2025-06-11 02:34:13');
