INSERT INTO `footer_contents` (`id`, `language_id`, `about_company`, `copyright_text`, `created_at`, `updated_at`) VALUES
(5, 20, 'Estrutura do  da plataforma \r\nA plataforma feirão show car é a nova maneira das pessoas adquirirem seu veículo de forma descomplicada , facil e segura . \r\nFeirão show car é uma plataforma moderna e eficiente no quesito tecnologia . Nosso sistema conta sem busca aprimorada de todos dos veículos desejados pois ela contará com a participação dos melhores logistas do Mato Grosso do Sul . \r\nNossa plataforma é totalmente imersivo e conta com locução ao vivo , atendimento rápido e personalizado dos bancários , roleta de prémios e cupons de descontos é muito mais .', '<p>Copyright ©2025. All Rights Reserved. @feiraoshowcar</p>', '2023-08-19 23:40:53', '2025-06-17 13:58:26');
